import Vue from "vue";
import App from "./App.vue";
import router from "./router"; // Asegúrate de importar correctamente tu archivo de enrutador

new Vue({
  router, // Asegúrate de que estés pasando el router a la instancia de Vue
  render: (h) => h(App),
}).$mount("#app");
